import React, { useState } from "react";

export default function SignIn() {
  const [email, setEmail] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
  }

  return (
    <form action="/authenticate" method="POST" onSubmit={handleSubmit}>
      <fieldset>
        <label for="email">E-mail</label>
        <input for="email" type="email" value={email} inputmode="email" autocomplete="username" onChange={e => setEmail(e.target.value)} />
      </fieldset>
      <fieldset>
        <label for="password">Senha</label>
        <input for="password" type="password" name="password" autocomplete="current-password" />
      </fieldset>
      <button type="submit">Entrar</button>1
    </form>
  )
}
